import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
 } from "react-router-dom";

import { NavBar } from "./components/NavBar/navbar";
import { Home } from "./components/Main/home";
import { CreateAccount} from "./components/Main/createaccount";
import { Deposit } from "./components/Main/deposit";
import { Withdraw } from "./components/Main/withdraw";
import { AllData } from "./components/Main/alldata";

function App() {


  return (
    <Router>
      <NavBar/>
      <Switch>
        <Route path="/" exact>
          Esta es la pagina de Home
        </Route>
        <Route path="/contacto">
          Esta es la pagina de contacto
        </Route>
        <Route path="/contacto">
          Esta es la pagina de contacto
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
